import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

function ListaClientes() {
    const [clientes, setClientes] = useState([]);
    const navigate = useNavigate();

    // Simulação de requisição ao backend
    useEffect(() => {
        const clientesFake = [
            { id: 1, nome: 'Cliente 1', numero: '123456789' },
            { id: 2, nome: 'Cliente 2', numero: '987654321' }
        ];
        setClientes(clientesFake);
    }, []);

    const handleCliqueCliente = (id) => {
        navigate(`/detalhes/${id}`); // Navega para a tela de detalhes
    };

    return (
        <div>
            <h1>Lista de Clientes</h1>
            <ul>
                {clientes.map(cliente => (
                    <li key={cliente.id} onClick={() => handleCliqueCliente(cliente.id)}>
                        {cliente.nome} - {cliente.numero}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default ListaClientes;
